import './testSelection.css';
import Room1 from '../Images/room1.jpg';
export default function(){
    return(
        <form>
           <input type="radio" id="radioButton" name="radioGroup" value="option1" />
            <label for="radioButton" class="radioImageLabel">
                <div><h1>Selected</h1></div>
                <img src={Room1} alt="Radio Button" />
            </label>
        </form>
    )
}
